import React, {FunctionComponent} from 'react';

interface Details {
    name: string,
    type: string
}




const HeroesDetail: React.FC <Details> = ({name, type}) => {
    return (
        <div>
            <h3>{name}</h3>
            <p>{type}</p>
        </div>
    )
}


export default HeroesDetail
